it unserem Support-Team','AI Chatbot support sidebar paragraphHere to provide quick answers to your questions. It’s never been easier to find the right resource.'=>'Hier, um schnelle Antworten auf deine Fragen zu geben. Es war noch nie einfacher, die richtigen Ressourcen zu finden.','AI Chatbot sidebar headerAI Chatbot'=>'AI-Chatbot','Describes why consent is beneficialOur Help page is better than ever with the addition of:'=>'Unsere Hilfeseite ist besser denn je mit der Ergänzung von:','Help page resources sidebar headerOur TEC support hub now offers an improved help experience'=>'Unser TEC-Support-Hub bietet jetzt ein verbessertes Hilfe-Erlebnis.','Link to the Help ChatbotTalk to TEC Chatbot'=>'Sprich mit dem TEC-Chatbot','AI Chatbot section paragraphYou have questions? The TEC Chatbot has the answers.'=>'Du hast Fragen? Der TEC-Chatbot hat die Antworten.','AI Chatbot notice titleOur AI Chatbot is here to help you'=>'Unser AI-Chatbot ist hier, um dir zu helfen.','The callout notice to try the chatbot with a link to the pageTo find the answer to all your questions use the %1$sTEC Chatbot%2$s'=>'Um die Antwort auf all deine Fragen zu finden, benutze den %1$sTEC-Chatbot%2$s.','Help on setting up, customizing, and troubleshooting your calendar. See our %1$s for in-depth content.'=>'Hilfe beim Einrichten, Anpassen und Beheben von Problemen mit deinem Kalender. Sieh dir unser %1$s für ausführliche Inhalte an.','Resources tab titleResources'=>'Ressourcen','Getting started guide section paragraphEasy to follow step-by-step instructions to make the most out of your calendar.'=>'Einfache Schritt-für-Schritt-Anleitungen, um das Beste aus deinem Kalender herauszuholen.','Getting started guide section titleGetting started guides'=>'Einsteigeranleitungen','FAQs section paragraphGet quick answers to common questions'=>'Erhalte schnelle Antworten auf häufige Fragen','FAQs section titleFAQs'=>'FAQs','Customization guides section paragraphTips and tricks on making your calendar just the way you want it.'=>'Tipps und Tricks, um deinen Kalender genau so zu gestalten, wie du es möchtest.','Customization guides section titleCustomization guides'=>'Anpassungsanleitungen','AI Chatbot'=>'AI-Chatbot','Having trouble? Find solutions to common issues or ask our %s.'=>'Hast du Probleme? Finde Lösungen für häufige Probleme oder frag unseren %s.','Common issues section titleCommon issues'=>'Häufige Probleme','Main Help Hub Navigation'=>'Haupt Hilfe Hub Navigation','Close settings navigation'=>'Einstellungen Navigation schließen','Settings Navigation'=>'Einstellungen Navigation','Support Hub'=>'Support-Hub','Label for the Community tab.Community'=>'Community','Events > Settings > Integrations'=>'Veranstaltungen > Einstellungen > Integrationen','To import Meetup events, please be sure to add your Meetup API key here:'=>'Um Meetup-Events zu importieren, stelle bitte sicher, dass du hier deinen Meetup-API-Schlüssel hinzufügst:',' The owner of the original event source (e.g. the iCalendar feed or Meetup group) might also make changes to their event. If you choose to re-import an altered event (manually or via a scheduled import), any changes made at the source or on your calendar will need to be addressed.'=>' Der Besitzer der ursprünglichen Veranstaltungsquelle (z. B. des iCalendar-Feeds oder der Meetup-Gruppe) kann ebenfalls Änderungen an seiner Veranstaltung vornehmen. Wenn Du eine geänderte Veranstaltung erneut importieren (manuell oder über einen geplanten Import) willst, müssen alle an der Quelle oder in deinem Kalender vorgenommenen Änderungen berücksichtigt werden.','You can make changes to imported events via The Events Calendar and see those changes reflected on your site’s calendar.'=>'Du kannst Änderungen an importierten Events über den Events-Kalender vornehmen und sie werden auf dem Kalender deiner Seite angezeigt.','Check out Event Aggregator'=>'Schauen Sie sich den Event Aggregator an','Check your Event Aggregator Service Statu