 Standard-API-Schlüssel für grundlegende Kartenfunktionen geliefert. Wenn du erweiterte Funktionen wie benutzerdefinierte Kartenmarkierungen oder dynamisches Laden von Karten verwenden möchtest, benötigst du einen eigenen %2$sGoogle Maps-API-Schlüssel%3$s.%4$s','Advanced Google Maps functionality'=>'Erweiterte Google Maps-Funktionalität','Get Event Tickets to manage attendee registration and ticket sales to your events, for free.'=>'Hole dir Event Tickets, um die Teilnehmerregistrierung und den Ticketverkauf für deine Veranstaltungen kostenlos zu verwalten.','Start selling tickets to your events'=>'Beginne mit dem Verkauf von Karten für deine Veranstaltungen','Enter the format to use for displaying dates with the year. Used when showing an event from a future year. Example: %1$s'=>'Gebe das Format ein, das für die Anzeige von Datumsangaben mit dem Jahr verwendet werden soll. Wird verwendet, wenn eine Veranstaltung für ein zukünftiges Jahr angezeigt wird. Beispiel: %1$s','Default Styles'=>'Standard-Stile',' Check out our <a href="%s" rel="noopener" target="_blank">customization guide</a> for instructions on template modifications.'=>' In unserem <a href="%s" rel="noopener" target="_blank">Anpassungsleitfaden</a> findest du Anweisungen zu Vorlagenänderungen.','The text label for the Month View.Month'=>'Monat','The text label for the List View.List'=>'Liste','The text label for the Day View.Day'=>'Tag','The default title text for the today button.Click to select today\'s date'=>'Klicke, um das heutige Datum auszuwählen','The default text for the \'today\' button\'s title and aria-label on the Week View.Click to select the current month'=>'Klicke, um den aktuellen Monat auszuwählen','The default text label for the "today" button on the Month View.This Month'=>'Dieser Monat','Dates set using the start_date/end_date, starts_*/ends_* are set to start at the specified times. The default behavior is to include the entire days.'=>'Daten, die mit start_date/end_date, starts_*/ends_* gesetzt werden, werden zu den angegebenen Zeiten beginnen. Das vorgegebene Verhalten ist, die kompletten Tage mit einzuschliessen.','Events that end after the specified date'=>'Veranstaltungen, die nach dem angegebenen Datum enden','Events that end before the specified date'=>'Veranstaltungen, die vor dem angegebenen Datum enden','Events that end on the specified date'=>'Veranstaltungen, die am angegebenen Datum enden','Events that start on the specified date'=>'Veranstaltungen, die am angegebenen Datum beginnen','Text label for control to hide restricted events on main calendar views.Hide restricted events on calendar views.'=>'Verstecke eingeschränkte Veranstaltungen in den Kalenderansichten.','The default text label for the "today" button on main calendar views.Today'=>'Heute','CSV File Formatting and Examples '=>'CSV-Dateiformatierung und Beispiele ','Importing Calendar Data From a CSV File'=>'Importieren von Kalenderdaten aus einer CSV-Datei','Need assistance? You can find more information here:'=>'Brauchst Du Unterstützung? Weitere Informationen findest Du hier:','To complete this major calendar upgrade, you need to migrate your events to the new data storage system. Once migration finishes, you can take advantage of all the cool new 6.0 features!'=>'Um dieses große Kalender-Upgrade abzuschließen, musst Du Deine Veranstaltungen auf das neue Datenspeichersystem migrieren. Sobald die Migration abgeschlossen ist, kannst Du alle coolen neuen Funktionen von 6.0 nutzen!','One more thing left to do...'=>'Es bleibt nur noch eines zu tun…','The Events Calendar: Custom Tables v1 - error'=>'Der Veranstaltungskalender: Benutzerdefinierte Tabellen v1 - Fehler','Automatic imports will be paused until migration is complete.'=>'Automatischer Import wurde angehalten bis die Migration durchgeführt wurde.','Event submissions will be paused until migration is complete.'=>'Die Einreichung von Veranstaltungen wird angehalten, bis die Migration abgeschlossen ist.','Ticket sales and RSVPs will be paused until migration is complete.'=>'Ticketverkäufe und Reservierungen wurden angehalten bis die Migration durchgeführt wurde.','Ticket sales, RSVPs, and event submissions will be paused until migration is complete.'=>'Ticketverkäufe, Reservierungen und Veranstaltungsanmeldungen werden pausiert, bis die Migration abgeschlossen ist.','Event submissions and automatic imports will be paused until migration is complete.'=>'Die Einreichung von Veranstaltungen  und der automatische Import werden angehalten, bis die Migration abgeschlossen ist.','Ticket sales, RSVPs, and automatic imports will be paused until migration is complete.'=>'Ticketverkäufe, Reservierungen und automatische Importe werden pausiert, bis die Migration abgeschlossen ist.','Ticket sales, RSVPs, event submissions, and automatic imports will be paused until migration is complete.'=>'Ticketverkäufe, Reservierungen, Veranstaltungsanmeldungen und automatische Importe werden pausiert, bis die Migration abgeschlossen ist.','Download report'=>'Report downloaden','View the error report'=>'Fehlerreport ansehen','Migration failed'=>'Migration fehlgeschlagen','Migration attempted'=>'Migration durchgeführt','We detected an event that cannot be properly migrated. Please review the report below for more information. This issue must be resolved before you can migrate your site. Once you have updated or removed the problematic event, re-run the migration preview to make sure your site is ready to go.'=>'Wir haben eine Veranstaltung entdeckt, das nicht richtig migriert werden kann. Weitere Informationen findest Du im unten stehenden Bericht. Dieses Problem muss behoben werden, bevor Du Deine Website migrieren kannst. Sobald Du das problematische Veranstaltung aktualisiert oder entfernt hast, führe die Migrationsvorschau erneut durch, um sicherzustellen, dass Deine Website einsatzbereit ist.','Your site could not be safely migrated to the new events system.'=>'Deine Seite konnte nicht sicher auf das neue Veranstaltungssystem migriert werden.','Migration failure'=>'Migration fehlgeschlagen','Okay'=>'OK','Migration reversed'=>'Migration rückgängig gemacht','Migration canceled'=>'Migration abgebrochen','View the migration report'=>'Den Migrationsbericht ansehen','The event %s generated an unknown error. Please try again or check out our %sTroubleshooting%s tips.'=>'Die Veranstaltung %s hat einen unbekannten Fehler erzeugt. Bitte versuche es erneut oder sieh Dir unsere %sProblembehanldung%s Tipps an.','The event %s generated an error: Cannot enqueue action to check migration status. Your site may be under high load and unable to process the necessary requests. Try again when site activity is low.'=>'Die Veranstaltung %s hat einen Fehler erzeugt: Aktion zur Überprüfung des Migrationsstatus kann nicht ausgeführt werden. Möglicherweise ist Deine Website stark ausgelastet und kann die erforderlichen Anfragen nicht bearbeiten. Versuche es noch einmal, wenn die Aktivität der Website gering ist.','The event %s generated an error: Cannot enqueue action to migrate Event with post ID %s. Your site may be under high load and unable to process the necessary requests. Try again later.'=>'Die Veranstaltung %s hat einen Fehler erzeugt: Aktion zur Migration des Ereignisses mit der Beitrags-ID %s kann nicht ausgeführt werden. Deine Website ist möglicherweise stark belastet und kann die erforderlichen Anfragen nicht verarbeiten. Versuche es später noch einmal.','The event %s cannot be migrated because we do not yet support tickets on recurring events. Remove the tickets or wait to migrate until a path is available (%sRead more%s).'=>'Die Veranstaltung %s kann nicht migriert werden, weil wir Tickets für wiederkehrende Veranstaltungen noch nicht unterstützen. Entferne die Tickets oder warte mit der Migration, bis ein Pfad verfügbar ist (%sWeiterlesen%s).','The event %s generated an error: [%s]. Please try again or check out our %sTroubleshooting%s tips.'=>'Die Veranstaltung %s hat einen Fehler verursacht: [%s]. Bitte versuche es erneut oder sieh Dir unsere %sProblembehandlung%s Tipps an.','The event %s generated an error: The "die" or "exit" function was called during the migration process; output: %s. Please try again or check out our %sTroubleshooting%s tips.'=>'Die Veranstaltung %s hat einen Fehler erzeugt: Die Funktion "die" oder "exit" wurde während des Migrationsprozesses aufgerufen; Ausgabe: %s. Bitte versuche es noch einmal oder sieh Dir unsere %sProblembehandlung%s Tipps an.','The event %s generated an error: Migration was canceled. Please try again.'=>'Die Veranstaltung %s hat einen Fehler erzeugt: Die Migration wurde abgebrochen. Bitte versuche es erneut.','The event %s generated an error: [%s]. Update the event and try again, or check out our %sTroubleshooting%s tips.'=>'Die Veranstaltung %s hat einen Fehler verursacht: [%s]. Aktualisiere das Veranstaltung und versuche es erneut, oder sieh Dir unsere %sProblembehandlung%s Tipps an.','Number of events awaiting migration%1$s%2$d%3$s remaining'=>'%1$s%2$d%3$s übrig','Number of events migrated%1$s%2$d%3$s events migrated'=>'%1$s%2$d%3$s Veranstaltungen migriert','Number of events awaiting preview%1$s%2$d%3$s remaining'=>'%1$s%2$d%3$s übrig','Number of events previewed%1$s%2$d%3$s events previewed'=>'%1$s%2$d%3$s Veranstaltungen in der Vorschau','We detected one or more events that cannot be properly migrated. Please review the report below for more information. These issues must be resolved before you can migrate your site. Once you have updated or removed problematic events, please re-run the migration preview.'=>'Wir haben ein oder mehrere Veranstaltungen entdeckt, die nicht richtig migriert werden können. Weitere Informationen findest Du im unten stehenden Bericht. Diese Probleme müssen behoben werden, bevor Du Deine Website migrieren kannst. Sobald Du die problematischen Veranstaltungen aktualisiert oder entfernt hast, führe bitte die Migrationsvorschau erneut durch.','Migration help'=>'Hilfe zur Migration','Unknown strategy applied to this event.'=>'Unbekannte Strategie für dieses Veranstaltung.','The following %1$s have been migrated with no adjustments:'=>'Die folgenden %1$s sind ohne Anpassungen migriert worden:','The following %1$s will be migrated with no adjustments:'=>'Die folgenden %1$s werden ohne Anpassungen migriert:','Events can migrate with no changes!'=>'Veranstaltungen können ohne Änderungen migriert werden!','We are reversing your site\'s migration to the new system. During this time, %1$syou cannot create, edit, or manage your events%2$s. Your calendar will still be visible on your site but some frontend actions will be paused.'=>'Wir machen die Umstellung deiner Seite auf das neue System rückgängig. Während dieser Zeit kannst Du %1$s keine Veranstaltungen erstellen, bearbeiten oder verwalten%2$s. Dein Kalender wird weiterhin auf deiner Seite sichtbar sein, aber einige Frontend-Aktionen werden pausiert.','Reverse migration in progress'=>'Rückgängigmachung der Migration im Gange','Reverse migration complete.'=>'Rückgängigmachung der Migration abgeschlossen.','Cancelation complete.'=>'Abbruch erfolgreich.','We are canceling your site\'s migration to the new system. During this time, %1$syou cannot create, edit, or manage your events%2$s. Your calendar will still be visible on your site but some frontend actions will be paused.'=>'Wir brechen die Migration deiner Seite auf das neue System ab. Während dieser Zeit kannst Du %1$skeine Veranstaltungen erstellen, bearbeiten oder verwalten%2$s. Dein Kalender wird weiterhin auf deiner Website sichtbar sein, aber einige Frontend-Aktionen werden pausiert.','Cancelation in progress'=>'Abbruch in Arbeit','Reverse migration'=>'Migration rückgängig machen','Total events migrated:'=>'Anzahl migrierter Veranstaltungen:','Migration completed'=>'Migration abgeschlossen','Your site is now using the upgraded event data storage system. Go ahead and %1$scheck out your events%2$s or %3$sview your calendar.%2$s'=>'Deine Website verwendet jetzt das aktualisierte System zur Speicherung von Veranstaltungsdaten. Mach weiter und %1$sschaue Dir Deine Veranstaltungen%2$s oder %3$s deinen Kalender an.%2$s','Migration complete!'=>'Migration abgeschlossen!','Cancel Migration Preview'=>'Migrationsvorschau abbrechen','Retry'=>'Erneut versuchen','Cancel Migration'=>'Migration abbrechen','Your events are being migrated to the new system. During migration, %1$syou cannot make changes to your calendar or events.%2$s Your calendar will still be visible on the frontend.'=>'Deine Veranstaltungen werden in das neue System migriert. Während der Migration kannst Du %1$skeine Änderungen an deinem Kalender oder deinen Veranstaltungen vornehmen.%2$s Dein Kalender ist weiterhin im Frontend sichtbar.','Migration in progress'=>'Migration wird durchgeführt','(Estimated time: %1$s minutes)'=>'(Geschätzte Dauer: %1$s Minuten)','(Estimated time: %1$s minute)'=>'(Geschätzte Zeit: %1$s Minuten)','Start migration'=>'Migration starten','Total events previewed:'=>'Anzahl Veranstaltungen Vorschau:','Preview completed'=>'Vorschau abgeschlossen','Your system doesn\'t allow us to run a preview, but you can still try a migration. During migration, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Dein System erlaubt uns nicht, eine Vorschau auszuführen, aber Du kannst trotzdem eine Migration versuchen. Während der Migration %1$skannst Du keine Veranstaltungen erstellen, bearbeiten oder verwalten.%2$s Dein Kalender ist weiterhin auf der Website sichtbar.','From this preview, we estimate that the full migration process will take approximately %3$d minutes. During this time, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Anhand dieser Vorschau schätzen wir, dass der gesamte Migrationsprozess etwa %3$d Minuten dauern wird. Während dieser Zeit %1$skannst Du keine Veranstaltungen erstellen, bearbeiten oder verwalten.%2$s Dein Kalender ist aber weiterhin auf deiner Website sichtbar.','The migration preview is done and ready for your review. No changes have been made to your events, but this report shows what adjustments will be made during the migration to the new system. If you have any questions, please %1$sreach out to our support team%2$s.'=>'Die Migrationsvorschau ist fertig und bereit für Deine Überprüfung. Es wurden keine Änderungen an deinen Veranstaltungen vorgenommen, aber dieser Bericht zeigt, welche Anpassungen während der Migration zum neuen System vorgenommen werden. Wenn Du Fragen hast, wende dich bitte %1$san unser Support-Team%2$s.','Preview complete'=>'Vorschau abgeschlossen','We\'re scanning your existing events so you\'ll know what to expect from the migration process. You can keep using your site and managing events. Check back later for the next step of migration.'=>'Wir scannen die existierenden Veranstaltungen, damit Du weißt, was Dich bei der Migration erwartet. Du kannst Deine Website weiter nutzen und Veranstaltungen verwalten. Schau später für den nächsten Schritt der Migration wieder vorbei.','Migration preview in progress'=>'Migrationsvorschau in Arbeit','Start migration preview'=>'Migrationsvorschau starten','Learn more about the migration'=>'Erfahre mehr über die Migration','https://evnt.is/1b79'=>'https://evnt.is/1b79','We\'ll scan your events and let you know how long your migration will take. The preview runs in the background, so you\'ll be able to continue using your site.'=>'Wir scannen Deine Veranstaltungen und teilen Dir mit, wie lange Deine Migration dauern wird. Die Vorschau läuft im Hintergrund, sodass Du Deine Website weiter nutzen kannst.','Ready to go? The first step is a migration preview.'=>'Können wir loslegen? Der erste Schritt ist eine Migrationsvorschau.','We\'ve completely revamped the way event information is stored on your site\'s database. Upgrade now to take advantage of faster calendar load times and improved performance. As with any significant site change, we recommend %screating a site backup%s before beginning the migration process.'=>'Wir haben die Art und Weise, wie Veranstaltungesinformationen in der Datenbank Deiner Website gespeichert werden, komplett überarbeitet. Führe jetzt ein Upgrade durch, um von schnelleren Kalenderladezeiten und verbesserter Leistung zu profitieren. Wie bei jeder wesentlichen Website-Änderung empfehlen wir, %seine Website-Sicherung zu erstellen%s, bevor Du mit dem Migrationsprozess beginnst.','Upgrade your event data storage system.'=>'Rüste dein System zur Speicherung von Veranstaltungsdaten auf.','Get ready for the new recurring events!'=>'Mache Dich bereit für die neuen wiederkehrenden Veranstaltungen!','Are you sure you want to reverse the recurring event system migration process?

- You will no longer be able to use the new recurring event and Series features.
- All event edits you have made since migration will be lost.
- As with migration, you will not be able to edit events or calendar options during this process and some frontend actions will be paused.
- Reverse migration should take less time than the original migration, but there is no time estimate available.
'=>'Möchtest Du den Systemmigrationsprozess für wiederkehrende Veranstaltungen wirklich rückgängig machen?

- Du kannst die neuen Funktionen für wiederkehrende Veranstaltungen und Serien nicht mehr verwenden.
- Alle Veranstaltungsbearbeitungen, die seit der Migration vorgenommen wurden, gehen verloren.
- Wie bei der Migration kannst Du während dieses Vorgangs keine Veranstaltungen oder Kalenderoptionen bearbeiten, und einige Frontend-Aktionen werden angehalten.
- Die umgekehrte Migration sollte weniger Zeit in Anspruch nehmen als die ursprüngliche Migration, es ist jedoch keine Zeitschätzung verfügbar.
','To safely cancel the migration, we need to reverse the process on any data that has already been modified. Your site will remain in maintenance mode until we have safely reversed the process.'=>'Um die Migration sicher abzubrechen, müssen wir den Prozess bei allen Daten, die bereits geändert wurden, rückgängig machen. Deine Website bleibt im Wartungsmodus, bis wir den Vorgang sicher rückgängig gemacht haben.','ID %1$d (Untitled)'=>'ID %1$d (ohne Titel)','The Events Calendar product suite logo'=>'Die Events Calendar Produktsuite Logo','Upgrade FAQ'=>'Upgrade FAQ','Version Compatibility'=>'Kompatibilität der Version','Plugins Page'=>'Plugin-Seite','You must update your version of Events Calendar Pro for access to calendar upgrades.'=>'Du musst Deine Version von Events Calendar Pro aktualisieren, um Zugang zu den Kalender-Upgrades zu erhalten.','Upgrade is not Available'=>'Upgrade ist nicht verfügbar','unknown'=>'unbekannt','Show more upcoming %1$s'=>'Mehr anstehende %1$s anzeigen','Show past %1$s'=>'Zeige vergangene %1$s','Re-run preview'=>'Vorschau nochmal starten','Resources'=>'Ressourcen','The Events Calendar guide'=>'The Events Calendar Leitfaden','Upgrade your events'=>'Upgrade Deine Veranstaltungen','<strong>Check out your calendar to see the improved designs live on your site.</strong> If you have a question or need help, %1$s or %2$s.'=>'<strong>Schau in deinem Kalender nach, um die verbesserten Designs live auf deiner Seite zu sehen.</strong> Wenn Du eine Frage hast oder Hilfe brauchst, wende dich an %1$s oder %2$s.','We’ve detected that your site was still using our legacy calendar design. As part of the update to The Events Calendar 6.0, <strong>your calendar was automatically upgraded to the new designs.</strong>'=>'Wir haben festgestellt, dass Deine Website noch unser altes Kalenderdesign verwendet hat. Im Rahmen des Updates auf den Veranstaltungskalender 6.0 <strong>wurde dein Kalender automatisch auf die neuen Designs aktualisiert.</strong>','Your calendar’s design has changed'=>'Das Design deines Kalenders hat sich geändert','View your calendar'=>'Deinen Kalender ansehen','Our support page for TECcontact support'=>'Support kontaktieren','Read more about deprecation of legacy views.read the FAQs'=>'Lies unsere FAQs','%s must be a valid HTML color code.'=>'%s muss ein gültiger HTML-Farbcode sein.','Duplicate events'=>'Doppelte Veranstaltungen','Recurring events & series'=>'Wiederkehrende Veranstaltungen & Serien','Use this image'=>'Dieses Bild verwenden','Remove Image'=>'Bild entfernen','Select Image'=>'Bild auswählen','Event Tickets REST API is not available.'=>'Die Event Tickets REST API ist nicht verfügbar.','Event Tickets plugin is not activated.'=>'Das Event Tickets Plugin ist nicht aktiviert.','Filter events with or without tickets.'=>'Filtere Veranstaltungen mit oder ohne Karten.','Troubleshooting Page'=>'Problembehandlungs-Seite','Add to calendar'=>'Zum Kalender hinzufügen','(View Full %1$s Description Here: %2$s)'=>'(Zeige vollständige %1$s-Beschreibung hier an: %2$s)','Export Outlook .ics file'=>'Exportiere Outlook .ics Datei','The text used for the link to the event archive in the admin post tag list.%s View'=>'%s Aufruf','Outlook Live'=>'Outlook Live','Outlook 365'=>'Outlook 365','GiveWP makes it easy to raise money online with donation forms, donor databases, and fundraising reporting.'=>'GiveWP macht es einfach, online Geld mit Spendenformularen, Spenderdatenbanken und Fundraising-Berichten zu sammeln.','Add Donations'=>'Spenden hinzufügen','The best WordPress donation plugin.'=>'Das beste WordPress-Spenden-Plugin.','Easy-to-use WooCommerce plugins work perfectly together, with any theme. Create a fast and profitable eCommerce store without any technical knowledge.
