xtension. Font control is now built into %1$sThe Events Calendar\'s options in the WordPress Customizer.%2$s Please disable the Inherit Theme Fonts extension to prevent conflicts with The Events Calendar.'=>'Du verwendest die Erweiterung "Inherit Theme Fonts". Die Schriftartensteuerung ist jetzt in die Optionen des %1$sThe Events Calendars im WordPress Customizer integriert.%2$s Bitte deaktiviere die Erweiterung "Inherit Theme Fonts", um Konflikte mit dem Veranstaltungskalender zu vermeiden.','Label for option to use the event background color. Links to the event background color setting.Use the <a href="%1$s">General Background Color</a>'=>'Verwende die <a href="%1$s">Standard-Hintergrundfarbe</a>','The Events Bar border color setting label.Border Color'=>'Randfarbe','Label for option to use the events background color. Links to the background color setting.Use the Calendar <a href="%1$s">Background Color</a>'=>'Benutze den Kalender <a href="%1$s">Background Color</a>','The Events Bar background color setting label.Background Color'=>'Hintergrundfarbe','Label for option to use the accent color (default). Links to the accent color setting.Use the <a href="%1$s">Accent Color</a>'=>'Benutze <a href="%1$s">Accent Color</a>','The "Find Events" button color setting label.Find Events Button Color'=>'Farbe "Veranstaltung finden"-Button','Label for option to use the accent color. Links to the accent color setting.Use the <a href="%1$s">Accent Color</a>'=>'Verwende die <a href="%1$s">Akzentfarbe</a>','Label for the default option.Default'=>'Standard','The Events Bar icon color setting label.Icons'=>'Icons','The "Find Events" button text color setting label.Find Events Button Text'=>'Farbe "Veranstaltung finden"-Text','The events bar text color setting label.Text Color'=>'Schriftfarbe','The header for the color control section.Adjust Appearance'=>'Design anpassen','Note about what these settings control.These settings control the search and options bar that appears above calendar views.'=>'Diese Einstellungen beeinflussen die Such- und Optionsleiste oben bei den Kalenderaufrufen.','Events Bar'=>'Veranstaltungsleiste','News from The Events Calendar'=>'Neuigkeiten von dem Events Kalender','Effortlessly fill your calendar with events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Fülle Deinen Kalender mühelos mit Veranstaltungen von Meetup, Eventbrite, iCal, Google Calendar und mehr.','Import events with ease'=>'Einfaches Importieren von Veranstaltungen','Events Aggregator'=>'Veranstaltungs-Aggregator','The Events Calendar, Event Tickets and their add-ons integrate with other online tools and services to bring you additional features. Use the settings below to connect to third-party APIs and manage your integrations.'=>'Der Veranstaltungskalender, die Veranstaltungstickets und deren Add-ons lassen sich in andere Online-Tools und -Dienste integrieren und bieten Ihnen zusätzliche Funktionen. Verwenden Sie die folgenden Einstellungen, um eine Verbindung zu APIs von Drittanbietern herzustellen und Ihre Integrationen zu verwalten.','The Events Calendar does not send any user data outside of your website by default.'=>'The Events Calendar versendet standardmäßig keine Benutzerdaten außerhalb deiner Website.','Create Eventbrite tickets and events right from your WordPress dashboard.'=>'Erstelle Eventbrite-Tickets und -Veranstaltungen direkt von deinem WordPress-Dashboard.','Enable 3rd party event submissions.'=>'Erlaube 3rd Party Veranstaltungseinreichungen.','Allow users to search for events by category, tag, venue, organizer, day of the week, time of day, and price.'=>'Erlaube Nutzern, nach Veranstaltungen nach Kategorie, Tag, Veranstaltungsort, Organisator, Wochentag, Tageszeit und Preis zu suchen.','Email marketing to promote your events'=>'E-Mail-Marketing zur Förderung deiner Veranstaltungen','Collect RSVPs and sell tickets'=>'Sammeln Sie RSVPs und verkaufen Sie Tickets','Import events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Importiere Veranstaltungen von Meetup, Eventbrite, iCal, Google Calendar und anderen.','The #1 calendar for WordPress'=>'Der #1 Kalender für WordPress','There are a few %s to resolve and prevent 404 errors.'=>'Es gibt ein paar %s, um 404-Fehler zu beheben und zu verhindern.','I keep getting “Page Not Found” on events.'=>'Ich bekomme ständig "Seite nicht gefunden" bei Veranstaltungen.','%s and other common installation issues.'=>'%s und andere häufige Installationsprobleme.','I installed the calendar and it crashed my site.'=>'Ich habe den Kalender installiert und er hat meine Seite zum Absturz gebracht.','This can happen when other plugins try to improve performance. %s.'=>'Dies kann passieren, wenn andere Plugins versuchen, die Leistung zu verbessern. %s.','My calendar doesn’t look right.'=>'Mein Kalender sieht nicht richtig aus.','Here’s an overview of %s and what they mean.'=>'Hier ist eine Übersicht über %s und was sie bedeuten.','Common Error Messages'=>'Häufige Fehlermeldungen','Check for updates'=>'Auf Updates prüfen','It\'s important to use the most recent versions of our plugins so that you have access to the latest features, bug fixes, and security updates. Plugin functionality can be compromised if your site is running outdated or mis-matched versions.'=>'Es ist wichtig, die neuesten Versionen unserer Plugins zu verwenden, damit du Zugriff auf die neuesten Funktionen, Fehlerbehebungen und Sicherheitsupdates hast. Die Funktionalität des Plugins kann beeinträchtigt werden, wenn deine Seite veraltete oder nicht übereinstimmende Versionen verwendet.','Plugin(s) are out of date'=>'Plugin(s) sind veraltet','Enter a custom API key'=>'Gib einen benutzerdefinierten API-Schlüssel ein','The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins, dynamic map loads, or Events Calendar Pro\'s Location Search and advanced Map View, you’ll need to get your own Google Maps API key and add it to Events > Settings > Integrations'=>'The Events Calendar wird mit einem API-Schlüssel für grundlegende Kartenfunktionen geliefert. Wenn du erweiterte Funktionen wie benutzerdefinierte Kartennadeln, dynamisches Laden von Karten oder die Standortsuche und die erweiterte Kartenansicht von Events Calendar Pro nutzen möchtest, musst du einen eigenen Google Maps-API-Schlüssel erhalten und ihn unter Events > Einstellungen > Integrationen hinzufügen.','Default Google Maps API key'=>'Standard Google Maps API Schlüssel','Manage your licenses'=>'Verwalte deine Lizenzen','License keys can only be used on a limited number of sites, which varies depending on your license level. You\'ll need to remove the license from one or more other site\'s in order to use it on this one.'=>'Lizenzschlüssel können nur auf einer begrenzten Anzahl von Websites verwendet werden, die je nach Lizenzstufe variiert. Sie müssen die Lizenz von einer oder mehreren anderen Websites entfernen, um sie auf dieser Website verwenden zu können.','Install max has been reached'=>'Maximale Installationen erreicht','Adjust your timezone'=>'Passe deine Zeitzone an','When using The Events Calendar, we highly recommend that you use a geographic timezone such as "America/Los_Angeles" and avoid using a UTC timezone offset such as “UTC+9”. Choosing a UTC timezone for your site or individual events may cause problems when importing events or with Daylight Saving Time. Go to your the General WordPress settings to adjust your site timezone.'=>'Bei der Nutzung des Veranstaltungskalenders empfehlen wir dringend, eine geografische Zeitzone wie „America/Los_Angeles“ zu verwenden und UTC-Zeitzonenabweichungen wie „UTC+9“ zu vermeiden. Die Wahl einer UTC-Zeitzone für Ihre Website oder einzelne Veranstaltungen kann beim Importieren von Veranstaltungen oder bei der Sommerzeit zu Problemen führen. Passen Sie die Zeitzone Ihrer Website in den allgemeinen WordPress-Einstellungen an.','Site time zone uses UTC'=>'Die Zeitzone der Seite verwendet UTC','This extension allows you to add custom HTML content to the top of the Community submission form.'=>'Dieses Add-on ermöglicht es dir, benutzerdefinierte HTML-Inhalte oben im Community-Einreichungsformular hinzuzufügen.','Display Custom HTML'=>'Benutzerdefiniertes HTML anzeigen','This extension allows you to hide the Organizers and Venues that a visitor has not created from the Community submission form.'=>'Mit dieser Erweiterung können Sie die Organisatoren und Veranstaltungsorte ausblenden, die ein Besucher nicht aus dem Community-Übermittlungsformular erstellt hat.','Hide Others’ Organizers and Venues'=>'Andere Veranstalter und Veranstaltungsorte ausblenden','This extension adds the “Show Google Maps” and “Show Google Maps Link” checkboxes when creating a new Venue.'=>'Dieses Add-on fügt die Kontrollkästchen "Google Maps anzeigen" und "Google Maps-Link anzeigen" hinzu, wenn ein neuer Veranstaltungsort erstellt wird.','Add Google Maps Display and Link Options'=>'Füge Google Maps-Anzeige- und Linkoptionen hinzu','This extension allows you to set default currency symbols for your users to choose from instead of having a plain text field.'=>'Mit dieser Erweiterung können Sie anstelle eines einfachen Textfelds Standardwährungssymbole festlegen, aus denen Ihre Benutzer auswählen können.','Add Cost Currency Symbol'=>'Währungszeichen für Kosten hinzufügen','This extension will send an email to event organizers whenever a user registers for their event.'=>'Dieses Add-on sendet eine E-Mail an die Veranstalter, wann immer sich ein Benutzer für ihre Veranstaltung registriert.','Organizer Notification Email'=>'Benachrichtigungs-E-Mail an den Veranstalter','Displays the information collected by “attendee meta fields” in the WooCommerce order screens as well.'=>'Zeigt die Informationen an, die durch "Teilnehmer-Metafelder" in den WooCommerce-Bestellbildschirmen gesammelt wurden.','Add Event & Attendee Info to WooCommerce Order Details'=>'Füge Veranstaltungs- und Teilnehmerinformationen zu WooCommerce-Bestelldetails hinzu','This extension shows a meta box with an API key on each Event with Ticket/RSVP.'=>'Dieses Add-on zeigt ein Metafeld mit einem API-Schlüssel für jedes Ereignis mit Ticket/RSVP.','Per Event Check In API'=>'Per Event Check-In API','Adds a new settings panel in Events > Settings that gives more control over the ticket and rsvp emails that are sent to attendees after registration.'=>'Fügt ein neues Einstellungsfenster unter „Events“ > „Einstellungen“ hinzu, das mehr Kontrolle über die Ticket- und RSVP-E-Mails bietet, die nach der Registrierung an die Teilnehmer gesendet werden.','Ticket Email Settings'=>'Ticket-E-Mail-Einstellungen','When it comes to paid tickets, these orders can be refunded through the e-commerce platform in use.'=>'Wenn es um kostenpflichtige Tickets geht, können diese Bestellungen über die verwendete E-Commerce-Plattform zurückerstattet werden.','How do I process refunds for tickets?'=>'Wie bearbeite ich Rückerstattungen für Tickets?','Yes! You can easily accomplish this task using the stock options and multiple ticket types available with Event Tickets.'=>'Ja! Du kannst diese Aufgabe ganz einfach mit den Standardoptionen und mehreren Ticketarten, die mit Event Tickets verfügbar sind, erledigen.','Can I have a seating chart associated with my tickets?'=>'Kann ich ein Sitzplan mit meinen Tickets verknüpfen?','You can sell tickets using our built-in e-commerce option, or upgrade to Event Tickets Plus to use ecommerce plugins such as WooCommerce.'=>'Sie können Tickets über unsere integrierte E-Commerce-Option verkaufen oder auf Event Tickets Plus upgraden, um E-Commerce-Plugins wie WooCommerce zu verwenden.','How Do I Set Up E-Commerce Plugins for Selling Tickets?'=>'Wie richte ich E-Commerce-Plugins zum Verkauf von Tickets ein?','We’ve put together a video tutorial showing how to create events with Tickets using our plugins. Click on the link in the link in th