er andere Code-Anpassungen an Deinem Kalender vorgenommen hast, werden diese Änderungen mit den neuen Designs überschrieben.','Existing calendar customizations will be overridden.'=>'Bestehende Kalender-Anpassungen werden überschrieben.','Confirm your upgrade'=>'Bestätige Dein Upgrade','Step 1 of 2'=>'Schritt 1 von 2','Learn more about the upgrade'=>'Erfahre mehr über das Upgrade','Start your upgrade'=>'Die Aktualisierung starten','We\'ve redesigned all of the calendar views to give you and your users a better experience. Beyond a brand new look, we\'ve optimized every design for mobile and introduced key improvements for each view.'=>'Wir haben alle Kalender-Ansichten neu gestaltet, um Dir und deinen Benutzern eine bessere Erfahrung zu bieten. Neben dem neuen Aussehen haben wir alle mobile Designs überarbeitet und wesentliche Verbesserungen für die jeweilige Ansicht eingeführt.','Upgrade your calendar.'=>'Aktualisiere Deinen Kalender.','A new look for The Events Calendar is here!'=>'Ein neuer look für den Veranstaltungskalender ist da!','screenshot of updated calendar views'=>'Screenshot der aktualisierten Kalender-Ansichten','Go check out your new calendar designs! Each calendar view has been updated, so feel free to enable views you may not have been using. If necessary, you can revert back to the legacy calendar views in the Display tab of your Event Settings.'=>'Schaue Dir die neuen Kalenderdesigns an! Jede Kalenderansicht wurde aktualisiert. Du kannst also Ansichten aktivieren, die Du möglicherweise bislang nicht verwendet hast. Bei Bedarf kannst Du auf der Registerkarte Anzeige Deiner Veranstaltungseinstellungen zu den alten Kalenderansichten zurückkehren.','You\'re all set!'=>'Umstellung auf das neue Kalenderdesign erfolgreich!','Add me to the list'=>'Füge mich zur Liste hinzu','Themer\'s Guide'=>'Themer\'s Guide','link for connecting meetupConnect to Meetup'=>'Mit Meetup verbinden','(do not override)'=>'(nicht überschreiben)','Start date for Eventbrite Tickets is Required'=>'Starttermin für Eventbrite-Tickets ist erforderlich','Log into Meetup'=>'Log-in-Meetup','Please log in to enable event imports from Meetup.'=>'Bitte melde dich an, um den Import von Veranstaltungen aus Meetup zu aktivieren.','Import events directly from a public Eventbrite.com URL. Please note that only Live events (i.e. published events) can be imported via URL.'=>'Importieren von Veranstaltungen, die direkt von einer öffentlichen Eventbrite.com URL. Bitte beachte, dass nur Live-Veranstaltungen (also Veranstaltungen veröffentlicht) über die URL importiert werden können.','Enable WordPress Custom Fields on events in the classic editor.'=>'Aktiviere individuelle WordPress Felder bei Veranstaltungen im klassischen Editor.','Enable the Gutenberg block editor interface for creating events.'=>'Aktiviere den Gutenberg-Block-Editor für die Erstellung von Veranstaltungen.','To continue using The Events Calendar, please install the latest version of'=>'Weiter mit Dem Veranstaltungskalender bitte installiere die neueste Version von','Upgrade'=>'Upgrade','Upgrade your calendar views'=>'Aktualisiere Deine Kalender-Ansichten','Welcome to The Events Calendar!'=>'Willkommen auf Dem Veranstaltungskalender!','Choosing a UTC timezone for your site or individual events may cause problems when importing events or with Daylight Saving Time. %1$s'=>'Die Auswahl einer UTC-Zeitzone für Deine Website oder einzelne Veranstaltungen kann zu Problemen beim Import von Veranstaltungen oder bei der Sommerzeit führen. %1$s','When using The Events Calendar, we recommend that you use a geographic timezone such as "America/Los_Angeles" and avoid using a UTC timezone offset such as “%2$s”.'=>'Wenn Du den Veranstaltungskalender verwendest, empfehlen wir Dir dringend, eine geografische Zeitzone wie "America / Los_Angeles" zu verwenden. Ein UTC-Zeitzonenversatz wie "%2$s" ist zu vermeiden, weil es zu Problemen kommen kann!','%s scheduled.'=>'%s geplant.','%s reverted to draft.'=>'%s zu Entwurf rückgängig gemacht.','%s published privately.'=>'%s privat veröffentlicht.','We recommend a 16:9 aspect ratio for featured images.'=>'Wir empfehlen ein Seitenverhältnis von 16: 9 für hervorgehobene Bilder.','The datepicker range definition when no events are found.Upcoming'=>'Anstehende','The datepicker label when the range start is now.Now'=>'Heute','Powered by'=>'Präsentiert von','And if you skip this, that\'s okay! %1$s will still work just fine.'=>'Und wenn Du das überspringst, ist das in Ordnung! %1$s wird immer noch gut funktionieren.','Hi, %1$s! This is an invitation to help our %2$s community. If you opt-in, some data about your usage of %2$s will be shared with our teams (so they can work their butts off to improve). We will also share some helpful info on events management, WordPress, and our products from time to time.'=>'Hallo,%1$s! Dies ist eine Einladung, unserer %2$s Community zu helfen. Wenn Du Dich anmeldst, werden einige Daten über Deine Verwendung von %2$s an unsere Teams weitergegeben (damit sie das Produkt verbessern können). Von Zeit zu Zeit werden wir auch einige hilfreiche Informationen zu Event Management, WordPress und unseren Produkten veröffentlichen.','We hope you love %1$s'=>'Wir hoffen, Du magst %1$s','The associated field is required.( required )'=>'( erforderlich )','Terms'=>'Bedingungen','and'=>'und','Privacy'=>'Datenschutz','Promoter All rights reserved.'=>'Promoter Alle Rechte vorbehalten.','Authorize Promoter'=>'Promoter autorisieren','Please authorize to continue onboarding.'=>'Bitte autorisiere, um mit dem Onboarding fortzufahren.','Sorry, unable to authenticate your site. Please contact Promoter support.'=>'Entschuldigung, konnte deine Seite nicht authentifizieren. Bitte kontaktiere den Promoter-Support.','Please log out and log back in as an admin account'=>'Bitte melde dich ab und wieder als Admin-Konto an','You do not have access to authenticate this site.'=>'Du hast keinen Zugriff, um diese Seite zu authentifizieren.','Please log in to continue'=>'Bitte melde dich an, um fortzufahren','Promoter would like to sync with your site'=>'Promoter möchte sich mit deiner Website synchronisieren','Licenses for Multisites'=>'Lizenzen für Multisites','Expired license keys and subscriptions'=>'Abgelaufene Lizenzschlüssel und Abonnements','Moving your license keys'=>'Verschieben deiner Lizenzschlüssel','View and manage your license keys'=>'Sieh dir deine Lizenzschlüssel an und verwalte sie','Why am I being told my license key is out of installs?'=>'Warum wird mir gesagt, dass mein Lizenzschlüssel keine Installationen mehr hat?','Helpful Links:'=>'Hilfreiche Links:','In order to register a plugin license, you\'ll first need to %1$sdownload and install%2$s the plugin you purchased. You can download the latest version of your plugin(s) from %3$syour account\'s downloads page%4$s. Once the plugin is installed and activated on this site, the license key field will appear below.'=>'Um eine Plugin-Lizenz zu registrieren, musst du zuerst %1$sdas Plugin herunterladen und installieren%2$s, das du gekauft hast. Du kannst die neueste Version deiner Plugins von %3$sideiner Download-Seite in deinem Konto%4$s herunterladen. Sobald das Plugin auf dieser Seite installiert und aktiviert ist, wird das Feld für den Lizenzschlüssel unten angezeigt.','If you\'ve purchased a premium add-on, you\'ll need to enter your license key here in order to have access to automatic updates when new versions are available.'=>'Wenn du ein Premium-Add-On gekauft hast, musst du hier deinen Lizenzschlüssel eingeben, um Zugriff auf automatische Updates zu haben, wenn neue Versionen verfügbar sind.','Select the date format used for elements with minimal space, such as in datepickers.'=>'Wähle das Datumsformat für Elemente mit minimalem Platzbedarf, z.B. in Datepickern.','Compact date format'=>'Kompaktes Datumsformat','North Macedonia'=>'Nordmazedonien','The Action Logger will dispatch any logging message using the "tribe_log" 