nizer'=>'Organisator Veranstaltung','All day'=>'Ganztägig','Show Map'=>'Zeige Karte','Enable Maps'=>'Aktiviere Karten','Show Map Link'=>'Kartenlink anzeigen','Show Map Link:'=>'Zeige Kartenlink:','Show Map:'=>'Zeige Karte:','Activate Block Editor for Events'=>'Den Blockeditor für Veranstaltungen aktivieren','Add Button Text'=>'Schaltflächen Text hinzufügen','Event Organizers'=>'Veranstalter','Unknown Column '=>'Unbekannte Spalte ','There was an error building the record queue: '=>'Beim Erstellen der Datensatzwarteschlange ist ein Fehler aufgetreten: ','(click here for details)'=>'(klicke hier für Details)','Event Blocks'=>'Veranstaltungen-Blocks','Add Description...'=>'Beschreibung hinzufügen...','F j'=>'j. F','F j, Y'=>'j. F Y','g:i a'=>'G:i','%s ago'=>'vor %s','%s from now'=>'in %s','Problem loading the block, please remove this block to restart.'=>'Problem beim Laden des Blocks, bitte diesen Block entfernen, um neu zu starten.','Text Array'=>'Text-Array','Numeric Array'=>'Numerisches Array','Show Custom Fields metabox'=>'Metabox für individuelle Felder anzeigen','Stop current processes'=>'Aktuelle Prozesse stoppen','The Asynchronous import process is faster and does not rely on WordPress Cron but might not work correctly in all WordPress installations, try switching to the Cron-based process for maximum compatibility.'=>'Der asynchrone Import-Prozess ist schneller und stützt sich nicht auf WordPress-Cron, funktioniert jedoch möglicherweise nicht korrekt in allen WordPress-Installationen. Versuchen die Umstellung auf den Cron-basierten Prozess für maximale Kompatibilität.','Import Process System'=>'Prozesssystem importieren','click here'=>'hier klicken','If you want to stop and clear current asynchronous import processes %1$s.'=>'Wenn Du aktuelle asynchrone Importprozesse %1$s stoppen und löschen möchtest.','Import from Eventbrite URL'=>'Importiere von einer Eventbrite URL','to create your own free Google Maps API key.'=>'um einen eigenen kostenlosen Google Maps API-Schlüssel zu erstellen.','If you do not add your own API key, the built-in API key will always populate this field and some map-related functionality will be limited '=>'Wenn Du keinen eigenen API-Schlüssel hinzufügst, wird dieses Feld immer mit dem integrierten API-Schlüssel gefüllt und einige kartenbezogene Funktionen sind eingeschränkt ','You are using The Events Calendar\'s built-in Google Maps API key.'=>'Du verwendest den integrierten Google Maps-API-Schlüssel des Veranstaltungskalenders.','<p>The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins or dynamic map loads, you’ll need to get your own %1$sGoogle Maps API key</a>. %2$sRead More</a>.</p>'=>'<p>Der Events Calendar kommt mit einem API-Schlüssel für grundlegende Kartenfunktionen. Wenn du fortgeschrittenere Funktionen wie benutzerdefinierte Kartenmarkierungen oder dynamische Kartenladevorgänge nutzen möchtest, musst du dir deinen eigenen %1$sGoogle Maps API-Schlüssel</a> besorgen. %2$sMehr erfahren</a>.</p>','to learn more about using it with The Events Calendar'=>'um mehr über die Verwendung mit The Events Calendar zu erfahren','You are using a custom Google Maps API key.'=>'Du verwendest einen benutzerdefinierten Google Maps-API-Schlüssel. ','Cron-based'=>'Cron-basierte','Asynchronous'=>'Asynchron','Unsupported'=>'Kein Support','Successfully stopped and cleared 1 asynchronous queue process.'=>'Erfolgreich gestoppt und gelöscht 1 die asynchrone queue-Prozess.' . "\0" . 'Erfolgreich gestoppt und gelöscht %d asynchrone Warteschlange verarbeitet.','No asynchronous queue processes to clear.'=>'Keine asynchronen queue-Prozesse zu deaktivieren.','The event tag ID or name'=>'Die event-tag-ID oder name','The event category ID or name'=>'Die Kategorie-ID oder der Name der Veranstaltung','Events should be filtered by their post_parent being the specified one.'=>'Die Veranstaltungen sollten anhand ihres post_parent gefiltert werden.','Include events with one of the post IDs specified in the array of CSV list, date filters will be ignored.'=>'Schließe Veranstaltungen mit einer der im Array der CSV-Liste angegebenen Post-IDs ein. Datumsfilter werden ignoriert.','Unable to process this import - a breakage or conflict may have resulted in the import halting.'=>'Nicht in der Lage zu verarbeiten diese zu importieren - ein Bruch oder Konflikt kann dazu geführt haben, in den import ins stocken.','Calendar of %s'=>'Kalender von %s','%s Views Navigation'=>'%s Ansichten-Navigation','%s Search and Views Navigation'=>'%s Suche und Ansichten, Navigation','If you have extended our plugin(s) to send data to a third-party service such as Eventbrite, Google Maps, or PayPal, user information may be passed to these external services. These services may be located abroad.'=>'Wenn Du unsere Plugin(s) erweitert hast, um Daten an einen Drittanbieter-Dienst wie Eventbrite, Google Maps oder PayPal, Benutzer-Informationen zu senden, können Informationen von Nutzern an diese externen Dienste weitergegeben werden. Diese Dienste haben ihren Sitz möglicherweise im Ausland.','Where We Send Your Data'=>'Wohin wir Deine Daten senden','Certain data may be exported or removed upon users’ requests via the existing Exporter or Eraser. Please note, however, that several “edge cases” exist in which we are unable to perfect the gathering and export of all data for your end users. We suggest running a search in your local database, as well as within the WordPress Dashboard, in order to identify all data collected and stored for your specific user requests.'=>'Gewisse Daten können auf Anforderungen der Nutzer exportiert oder entfernt werden. Bitte beachte jedoch, dass es mehrere "Grenzfälle" gibt, in denen wir nicht perfekt das Sammeln und Exportieren aller Daten für die Endbenutzer durchführen können. Wir empfehlen eine Suche in der lokalen Datenbank als auch im WordPress-Dashboard, um alle Daten des Nutzers zu identifizieren, die erhobenen und gespeichert wurden.','All information (data) is retained in the local database indefinitely, unless otherwise deleted.'=>'Alle Informationen (Daten) beibehalten wird, die in der lokalen Datenbank auf unbestimmte Zeit, sofern nicht anderweitig gelöscht.','How Long You Retain this Data'=>'Wie lange Du diese Daten behalten willst','We make use of certain APIs, in order to provide specific features.'=>'Wir nutzen bestimmte API-keys, um bestimmte Funktionen anzubieten.','The Events Calendar suite offers the use of third-party API keys. The primary functions are to enhance the features we\'ve built in, some of which use Google Maps, PayPal, Eventbrite, and Meetup. These API keys are not supplied by The Events Calendar.'=>'Die Events Calendar Suite bietet die Nutzung von Third-Party-API-Schlüssel. Die primären Funktionen sind die Erweiterung der eingebauten Funktionen, von denen einige Google Maps, PayPal, Eventbrite, und Meetup verwenden. Diese API-Schlüssel sind nicht im Lieferumfang des Events Calendar enthalten.','API Keys'=>'API-Schlüssel','When purchasing Eventbrite Tickets, attendee, purchaser, and order information are stored and managed by Eventbrite.'=>'Beim Kauf von Eventbrite Tickets werden Teilnehmer, Käufer und andere Bestelldaten gespeichert und von Eventbrite verwaltet.','Please note that to create new events through the Community Events submission form, a user must hold a website account on this domain. This information is retained in the local database. It is also possible to create events anonymously, if the site owner has this option enabled.'=>'Bitte beachte, dass zum Erstellen neuer Termine durch die Community-Events-Formular der Nutzer einen Online-Konto zu dieser Domain besitzen muss. Diese Informationen verbleiben in der lokalen Datenbank. Es ist auch möglich, Veranstaltungen anonym zu erstellen, wenn der Eigentümer der Website ist diese Option aktiviert hat.','Eventbrite Ticket information: name, description, cost, type, quantity'=>'Eventbrite Ticket-Informationen: Name, Beschreibung, Eintritt, Art, Menge','Import origin data (URL from where events are being imported—such as Eventbrite, MeetUp, other compatible URL sources, and more, which can include similar or same data as listed above)'=>'Importiere die Ursprungsdaten (URL, von der Veranstaltungen importiert werden, z. B. Eventbrite, MeetUp, andere kompatible URL-Quellen usw., die ähnliche oder dieselben Daten wie oben aufgeführt enthalten können.)','All data present within a CSV or ICS file and external URLs (for events, venues, organizers, and tickets)'=>'Alle vorhandenen Daten werden in einer CSV-oder ICS-Datei und externen URLs (für Events, Veranstaltungen, Veranstalter und Karten)','Importing Events, Venues, and Organizers:'=>'Importiere Veranstaltungen, Orte und Veranstalter:','Event information: website, cost, description, date, time, image'=>'Veranstaltungsinfo: Website, Eintritt, Beschreibung, Datum, Zeit, Bild','Organizer information: name, phone, website, email'=>'Veranstalter Info: Name, Telefon, Website, E-Mail','Venue information: name, address, city, country, state, postal code, phone, website, geographical coordinates (latitude and longitude)'=>'Veranstaltungsort Info: Name, Adresse, Stadt, Land, Bundesland, PLZ, Telefon, Website, Geo Koordinaten (Latitude und Longitude)','If you create, submit, import, save, or publish Event, Venue, or Organizer information, such information is retained in the local database:'=>'Wenn Du Veranstaltungs-, Veranstaltungsorte- oder Veranstalter-Informationen erstellen, übermitteln, importieren, speichern oder veröffentlichen werden diese in lokalen Datenbank gespeichert:','Suggested text:'=>'Vorgeschlagener Text:','Through the usage of The Events Calendar, Events Calendar PRO, The Events Calendar Filter Bar, Eventbrite Tickets, and Community Events plugins, as well as our Event Aggregator Import service (contained within The Events Calendar plugin), information may be collected and stored within 