 Eventbrite-URL beim Import von Eventbrite an.','Successfully fetched Eventbrite Token'=>'Erfolgreich holte Eventbrite-Token','No upcoming Eventbrite events found.'=>'Es wurden keine anstehenden Eventbrite Veranstaltungen gefunden.','Events cannot be imported because Eventbrite has returned an error. This could mean that the event ID does not exist, the event or source is marked as Private, or the event or source has been otherwise restricted by Eventbrite. You can <a href="https://theeventscalendar.com/knowledgebase/import-errors/" target="_blank">read more about Eventbrite restrictions in our knowledgebase</a>.'=>'Veranstaltungen können nicht importiert werden, da Eventbrite einen Fehler zurückgegeben hat. Dies kann bedeuten, dass die Veranstaltungs-ID nicht vorhanden ist, die Veranstaltung oder die Quelle als privat markiert ist oder die Veranstaltung oder die Quelle anderweitig von Eventbrite eingeschränkt wurde. <a href="https://theeventscalendar.com/knowledgebase/import-errors/" target="_blank"> Weitere Informationen zu Eventbrite-Einschränkungen finden sich in unserer Knowledgebase </a>.','The new status message slug, to allow for localized messages.'=>'Der neue Status-Nachricht-Permalink, um lokalisierte Nachrichten zu ermöglichen.','The new status message for the user, not localized.'=>'Der neue Status für den Nutzer, nicht lokalisiert.','The new status of the import.'=>'Der neue Status des Imports.','The current interval, in seconds, between the end of a batch process and the start of the next; as set on the server.'=>'Das aktuelle Intervall in Sekunden zwischen dem Ende eines batch-Prozesses und dem Beginn der nächsten; wie auf dem server.','The percentage of import completed.'=>'Der Anteil der import abgeschlossen.','The current status of the import.'=>'Der aktuelle status des Importvorgangs.','The hash of the next expected batch, as previously provided by the client'=>'Der Hash des nächsten erwarteten Stapels, wie zuvor vom Client bereitgestellt','The i