 during weekdays'=>'<strong>Benötigst du eine schnellere Unterstützung?</strong> Wir bieten %s mit dem Kauf eines unserer Premium Plugins. Wähle eine Lizenz und du kannst dort direkt deine Frage stellen und erhältst wochentags innerhalb von 24-48 Stunden eine Antwort.','premium support on our website'=>'Premium Support auf unserer Website','If you have tried the above steps and are still having trouble, you can post a new thread to our WordPress.org forums for %1$s or %2$s. Our support staff monitors these forums once a week and would be happy to assist you there. '=>'Wenn Du die Schritte oben schon versucht und immer noch Probleme hast, kannst Du eine Anfrage in unseren WordPress.org Foren für %1$s und %2$s einstellen. Unser Support Team überprüft diese Foren einmal wöchentlich und hilft Dir gerne weiter. ','Events Tickets'=>'Events Tickets','Customizing the Events plugins'=>'Die Veranstaltung Plugins anpassen','%s: Code and guides for customizing your calendar in useful and interesting ways.'=>'%s: Code und Anleitungen, um deinen Kalender auf sinnvolle und interessante Weise anzupassen.','Troubleshooting common problems'=>'Lösung allgemeiner Probleme','%s: Do you see an issue with your calendar? Go here first to find where it’s coming from and how to fix it.'=>'%s: Hast du einen Fehler in unserem Kalender entdeckt? Klicke hier, um herauszufinden, woher er kommt und wie er gelöst werden kann.','Using stylesheets and page templates'=>'Nutze Stylesheets und Seitenvorlagen','%s: An overview of the default templates and styles that are included in the plugin, as well as how to change them.'=>'%s: Ein Überblick über die Standard Vorlagen und Designs, welche im Plugin enthalten sind und wie man diese anpassen kann.','%s: Our most comprehensive outline for customizing the calendar to suit your needs, including custom layouts and styles.'=>'%s: Unsere umfassendste Anleitung, um den Kalender an deine Bedürfnisse anzupassen, inklusive individuellen Layouts und Designs.','Features overview'=>'Übersicht der Features','%s: A complete look at the features you can expect to see right out of the box as well as how to use them.'=>'%s: Eine komplette Übersicht der Funktionen, welche dich erwarten und wie sie benutzt werden können.','Settings overview'=>'Einstellungsübersicht','%s: A thorough walkthrough of The Events Calendar and the settings that are available to you.'=>'%s: Eine umfassender Überblick des Events Calendar und seiner Einstellungen sind für dich verfügbar.','Support for The Events Calendar'=>'Unterstützung für The Events Calendar','We are committed to helping make your calendar spectacular and have a wealth of resources available, including a handy %s to get your calendar up and running.'=>'Wir möchten, dass dein Kalender spektakulär wird und haben viele Hilfsmittel dafür verfügbar, inklusive praktische %s, um deinen Kalender in Gang zu bringen.','New User Primer'=>'Primer für neue Nutzer','CSV Import Settings'=>'CSV Import Einstellungen','Clear'=>'Löschen','Add another %s'=>'Weitere %s hinzufügen','Create New %s'=>'Neue %s erstellen','Unnamed %s'=>'Unbenannte(r) %s','Read more about our support policy'=>'Lies mehr über unsere Support-Richtlinien','Please note that all hands-on support is provided via the help desk. You can email or tweet at us… ​but we will probably point you back to the help desk 😄'=>'Bitte beachte, dass alle praktischen Unterstützungen über das Hilfecenter bereitgestellt werden. Du kannst uns eine E-Mail senden oder uns twittern... aber wir werden dich wahrscheinlich wieder zum Hilfecenter zurückverweisen 😄','%s. There are very few issues we haven’t seen and it’s likely another user has already asked your question and gotten an answer from our support staff. While posting to the help desk is open only to paid customers, they are open for anyone to search and review.'=>'%s. Es gibt nur wenige Probleme, die wir noch nicht kennen, und wahrscheinlich hat ein anderer Nutzer deine Frage bereits gestellt und eine Antwort von unserem Support-Team erhalten. Beiträge im Helpdesk sind zwar nur für zahlende Kunden zugänglich, die Suche und Überprüfung steht jedoch jedem offen.','Test for a theme or plugin conflict'=>'Teste auf ein Konflikt mit einem Theme oder Plugin','%s. Testing for an existing conflict is the best start for in-depth troubleshooting. We will often ask you to follow these steps when opening a new thread, so doing this ahead of time will be super helpful.'=>'%s. Das Testen auf bestehende Konflikte ist der beste Ausgangspunkt für eine gründliche Fehlerbehebung. Wir werden Sie oft bitten, diese Schritte beim Öffnen eines neuen Threads zu befolgen. Daher ist es sehr hilfreich, dies im Voraus zu tun.','Check our Knowledgebase'=>'Überprüfe unsere Wissensdatenbank','%s. All of the common (and not-so-common) answers to questions we see are here. It’s often the fastest path to finding an answer!'=>'%s. Alle häufigen (und weniger häufigen) Antworten auf unsere Fragen findest du hier. Das ist oft der schnellste Weg, eine Antwort zu finden!','While the resources above help solve a majority of the issues we see, there are times you might be looking for extra support. If you need assistance using our plugins and would like us to take a look, please follow these steps:'=>'Während die oben genannten Ressourcen die meisten Probleme lösen, kann es Zeiten geben, in denen du zusätzliche Unterstützung benötigst. Wenn du Hilfe bei der Nutzung unserer Plugins brauchst und möchtest, dass wir einen Blick darauf werfen, folge bitte diesen Schritten:','Getting More Help'=>'Mehr Hilfe bekommen','list of available functions'=>'Liste der verfügbaren Funktionen','Knowledgebase'=>'Wissensdatenbank','Our website’s %s is a great place to find tips and tricks for using and customizing our plugins.'=>'Unsere Website’s %s ist ein großartiger Ort, um Tipps und Tricks zur Nutzung und Anpassung unserer Plugins zu finden.','Getting Support'=>'Hilfe bekommen','Thank you for using %s! All of us at The Events Calendar sincerely appreciate your support and we’re excited to see you using our plugins.'=>'Danke, dass du %s verwendest! Wir alle bei The Events Calendar schätzen deine Unterstützung sehr und freuen uns, dass du unsere Plugins nutzt.','Thanks for setting up a valid key. It will expire on %s'=>'Danke, dass du einen gültigen Schlüssel eingerichtet hast. Er läuft am %s ab.','Visit the Add-on Page'=>'Besuche die Add-on-Seite','Plugin Inactive'=>'Plugin inaktiv','Plugin Active'=>'Plugin aktiv','Rating:'=>'Bewertung:','Active Users:'=>'Aktive Nutzer:','Install Plugin'=>'Plugin installieren','Install %s'=>'Installiere %s','Upgrade Plugin'=>'Plugin upgraden','Activate Plugin'=>'Plugin aktivieren','Activate %s'=>'Aktiviere %s','Community Tickets'=>'Community Tickets','Event Tickets Plus'=>'Event Tickets Plus','Facebook Events'=>'Facebook Events','Eventbrite Tickets'=>'Eventbrite Tickets',' and '=>' and ','Turbo charge your posts admin for any custom post type with sortable filters and columns, and auto-registration of metaboxes.'=>'Optimieren Sie die Leistung Ihrer Beitragsverwaltung für jeden benutzerdefinierten Beitragstyp mit sortierbaren Filtern und Spalten sowie der automatischen Registrierung von Metaboxen.','Advanced Post Manager'=>'Erweiterter Beitragsmanager','Events Tickets is a carefully crafted, extensible plugin that lets you easily sell tickets for your events.'=>'Events Tickets ist ein sorgfältig gestaltetes, erweiterbares Plugin, mit dem du ganz einfach Tickets für deine Veranstaltungen verkaufen kannst.','Event Tickets'=>'Event Tickets','The Events Calendar is a carefully crafted, extensible plugin that lets you easily share your events.'=>'Der Events Calendar ist ein sorgfältig gestaltetes, erweiterbares Plugin, mit dem du deine Veranstaltungen ganz einfach teilen kannst.','Completed!'=>'Abgeschlossen!','organizers'=>'Veranstalter','Event ID'=>'Veranstaltungs-ID','Cancel'=>'Abbrechen','%s must be a positive number or percent.'=>'%s muss eine positive 