w per page'=>'Anzahl der Veranstaltungen pro Seite','Show The Events Calendar link'=>'Den Link zum Veranstaltungskalender anzeigen','Check out the available add-ons.'=>'Schauen Sie sich die verfügbaren Add-Ons an.','Looking for additional functionality including recurring events, custom meta, community events, ticket sales and more?'=>'Wünschst du Dir erweiterte Funktionalität, einschließlich wiederkehrender Veranstaltungen, benutzerdefinierten Meta-Informationen, Community-Veranstaltungen, Ticketverkäufen und mehr?','Right here'=>'Genau hier','Where\'s my calendar?'=>'Wo ist mein Kalender?','Finding your calendar.'=>'Deinen Kalender finden.','Finding & extending your calendar.'=>'Deinen Kalender finden und erweitern.','If you are familiar with HTML, you can add additional code after the event template. Some themes may require this to help with styling or layout.'=>'Wenn Du mit HTML vertraut bist, kannst Du Code NACH der Veranstaltungsvorlage einfügen. Bei einigen Themes kann dies für Anpassungen am Layout und Design notwendig sein.','Add HTML after event content'=>'Folgender HTML-Code wird NACH der Veranstaltung hinzugefügt','If you are familiar with HTML, you can add additional code before the event template. Some themes may require this to help with styling or layout.'=>'Wenn Du mit HTML vertraut bist, kannst du Code VOR der Veranstaltungsvorlage einfügen. Bei einigen Themes kann dies für Anpassungen am Layout und Design notwendig sein.','Add HTML before event content'=>'Folgender HTML-Code wird VOR der Veranstaltung hinzugefügt','Enter the separator that will be used between the start and end time of an event.'=>'Gib bitte das Trennzeichen ein, das die Start- und Ende Uhrzeit einer Veranstaltung trennt.','Time range separator'=>'Zeitraum Trennzeichen','Enter the separator that will be placed between the date and time, when both are shown.'=>'Gib bitte das Trennzeichen ein, das Datum und Uhrzeit trennt, wenn beides angezeigt wird.','Date time separator'=>'Datum Z